import './App.css';
import Dogs from './components/Dogs';
import Landing from './components/Landing';
import { BrowserRouter, Route, } from 'react-router-dom';
import SearchBar from './components/Dogs/SearchBar/index';

function App() {
  return (
    <div className="App">
      <BrowserRouter>
      <Route exact path='/' component={Landing}></Route>
      <Route exact path='/home' component={Dogs}></Route>
      <Route path='/detail' component={Detail}></Route>
      <Route path='/created' component={Create}></Route>
      <Route path='*' component={error}></Route>{/* es para que sea una ruta que no existe  y que muestre el error */}

      </BrowserRouter>

    </div>
  );
}

export default App;
